import React from 'react'
import './Header.css'
import { Icon } from 'semantic-ui-react'


function Header() {
  return (
    <div className='main-page-header'>
        <nav>
        <i aria-hidden="true" class="home mini icon"></i>
        </nav>
    </div>
  )
}

export default Header
